import React, {Component} from 'react';
import CardUi from "./CardUi";
import './CardUiMain.css'
import logo from '../../images/logo.png'
import image1 from '../../images/HandWash.jpg'
import image2 from '../../images/survey.jpg'
import image3 from '../../images/World Map.jpg'
const dataItem=[
    {
        title:"health trips",
        info:""

    }
]



class CardUiMain extends Component {
    render() {
        return (
                <div className="container-fluid d-flex justify-content-center">
                    <div className="row">
                        <div className="col-md-4">
                            <CardUi imgsrc={image1} title={dataItem.title}/>
                        </div>
                        <div className="col-md-4">
                            <CardUi imgsrc={image2} title="Diagnose your chances of getting infected"/>
                        </div>
                        <div className="col-md-4">
                            <CardUi imgsrc={image3} title="World Live States"/>
                        </div>


                    </div>
                </div>
        );
    }
}

export default CardUiMain;
